import jsonPlacerHolder from '../apis/jsonPlaceHolder';

export const fetchPosts = () => {

    return function(dispatch, getState){

        const promise = jsonPlacerHolder.get('/posts');

        return {

            type: 'FETCH_POSTS',
            payload: promise

        }; 
    }


};
